"      </i>",
"      , 2010, 44(5):878-84.",
"      <span class=\"pubmed-id\">",
"       [PubMed",
"       <a href=\"UTD.htm?20/56/21379/abstract-text/20388859/pubmed\" id=\"20388859\" target=\"_blank\">",
