"      Holodniy M, Koch J, Mistal M, et al, \"A Double Blind, Randomized, Placebo-Controlled Phase II Study to Assess the Safety and Efficacy of Orally Administered SP-303 for the Symptomatic Treatment of Diarrhea in Patients With AIDS,\"",
"      <i>",
"       Am J Gastroenterol",
"      </i>",
"      , 1999, 94(11):3267-73.",
"      <span class=\"pubmed-id\">",
"       [PubMed",
"       <a href=\"UTD.htm?20/56/21379/abstract-text/10566728/pubmed\" id=\"10566728\" target=\"_blank\">",
